import { reactive, ref, computed } from 'vue'
import LoginPage from './LoginPage.vue'
import { useRouter } from 'vue-router'
import ButtonWeb from './ButtonWeb.vue'
import { useRegisterManager } from '@/stores/RegisterManager.js'
import AlertPopUp from './AlertPopUp.vue'
const registerStore = useRegisterManager()
const incorrect = ref(false)
const error = ref(false)
const success = ref(false)

// --- ปิด popup ด้วยมือ ---
// --- ปิด popup ด้วยมือ ---
const closePopUp = (operate) => {
  if (operate === 'incorrect') incorrect.value = false
  if (operate === 'problem') error.value = false
  if (operate === 'success ') success.value = false
}

// ✅ ฟังก์ชันสมัครสมาชิก
const submitForm = async () => {
  try {
    const data = await registerStore.registerAccount({
      userType: userType.value,
      fullName: form.fullName,
      email: form.email,
      password: form.password,
      dormitoryName: form.dormitoryName,
      gender: form.gender,
      staffId: form.staffId,
      position: form.position
    })

    // ✅ ตรวจผลลัพธ์
    if (data === '400' || data === '401') {
      incorrect.value = true
    } else if (data && data.success) {
      success.value = true
      setTimeout(() => {
        router.push({ name: 'login' })
      }, 1000)
    } else {
      error.value = true
    }
  } catch (err) {
    console.error('❌ Register error:', err)
    error.value = true
  }
}
const userType = ref('resident')
const returnLogin = ref(false)
const router = useRouter()
const isPasswordVisible = ref(false)
const isComfirmPasswordVisible = ref(false)
const form = reactive({
  fullName: '',
  email: '',
  password: '',
  confirmPassword: '',
  dormitoryName: '',
  gender: 'female',
  staffId: '',
  position: ''
})

const isEmailOverLimit = ref(false)
const isPasswordOverLimit = ref(false)
const isConfirmPasswordOverLimit = ref(false)
const isStaffIdOverLimit = ref(false)
// ใช้ computed สำหรับ trim ค่าอัตโนมัติ
const trimmedEmail = computed(() => form.email.trim())
const trimmedPassword = computed(() => form.password.trim())
const trimmedStaffID = computed(() => form.staffId.trim())
const trimmedConfirmPassword = computed(() => form.confirmPassword.trim())

// function submitForm() {
//   alert(`Account created for ${userType.value.toUpperCase()} ✅`)
// }
const returnLoginPage = async function () {
  router.replace({ name: 'login' })
  returnLogin.value = true
}
const togglePasswordVisibility = () => {
  isPasswordVisible.value = !isPasswordVisible.value
}
const toggleComfirmPasswordVisibility = () => {
  isComfirmPasswordVisible.value = !isComfirmPasswordVisible.value
}

// ฟังก์ชันรวมสำหรับตรวจความยาว input
const checkInputLength = (field) => {
  const MAX_EMAIL_LENGTH = 30
  const MAX_PASSWORD_LENGTH = 14
  const MAX_STAFFID_LENGTH = 11
  if (field === 'email') {
    const trimmed = form.email.trim()
    if (trimmed.length > MAX_EMAIL_LENGTH) {
      isEmailOverLimit.value = true
      form.email = trimmed.substring(0, MAX_EMAIL_LENGTH)
      setTimeout(() => {
        isEmailOverLimit.value = false
      }, 1000)
    } else {
      isEmailOverLimit.value = false
    }
  } else if (field === 'staffId') {
    const trimmed = form.staffId.trim()
    if (trimmed.length > MAX_STAFFID_LENGTH) {
      isStaffIdOverLimit.value = true
      form.staffId = trimmed.substring(0, MAX_STAFFID_LENGTH)
      setTimeout(() => {
        isStaffIdOverLimit.value = false
      }, 1000)
    } else {
      isStaffIdOverLimit.value = false
    }
  } else if (field === 'password') {
    const trimmed = form.password.trim()
    if (trimmed.length > MAX_PASSWORD_LENGTH) {
      isPasswordOverLimit.value = true
      form.password = trimmed.substring(0, MAX_PASSWORD_LENGTH)
      setTimeout(() => {
        isPasswordOverLimit.value = false
      }, 1000)
    } else {
      isPasswordOverLimit.value = false
    }
  } else if (field === 'confirmPassword') {
    const trimmed = form.confirmPassword.trim()
    if (trimmed.length > MAX_PASSWORD_LENGTH) {
      isConfirmPasswordOverLimit.value = true
      form.confirmPassword = trimmed.substring(0, MAX_PASSWORD_LENGTH)
      setTimeout(() => {
        isConfirmPasswordOverLimit.value = false
      }, 1000)
    } else {
      isConfirmPasswordOverLimit.value = false
    }
  }
}
